import React, { useState, useEffect } from 'react';

export default function Wishlist({ wishlistItems, onRemove }) {
  if (wishlistItems.length === 0) {
    return (
      <div className="min-h-screen bg-gray-50 pt-20">
        <div className="max-w-4xl mx-auto">
          <div className="bg-white rounded-lg shadow-lg p-8 text-center">
            <h2 className="text-3xl font-bold text-gray-800 mb-4">❤️ Votre liste de souhaits est vide</h2>
            <p className="text-gray-600">Ajoutez des articles à votre liste!</p>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-50 pt-20 pb-20">
      <div className="max-w-6xl mx-auto px-4">
        <h2 className="text-3xl font-bold text-gray-800 mb-8">❤️ Ma Liste de Souhaits</h2>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {wishlistItems.map((item) => (
            <div key={item._id} className="bg-white rounded-lg shadow-lg overflow-hidden card-hover">
              <div className="p-6">
                <h3 className="text-xl font-bold text-gray-800 mb-2">{item.name}</h3>
                <p className="text-gray-600 mb-3">{item.category}</p>
                <div className="flex justify-between items-center mb-4">
                  <span className="text-blue-600 font-bold text-lg">${item.price}</span>
                  <span className="text-yellow-500">⭐ {item.rating || 'N/A'}</span>
                </div>
                <button
                  onClick={() => onRemove(item._id)}
                  className="w-full px-4 py-2 bg-red-500 text-white rounded-lg hover:bg-red-600 transition"
                >
                  ❌ Supprimer de ma liste
                </button>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
